import React from 'react';

type UserProfileProps = {
  avatarUrl?: string;
  username: string;
  profession?: string;
  bio?: string;
  size?: number; // avatar size in pixels
};

const UserProfile: React.FC<UserProfileProps> = ({
  avatarUrl,
  username,
  profession,
  bio,
  size = 64,
}) => {
  const avatarStyle: React.CSSProperties = {
    width: size,
    height: size,
    borderRadius: '50%',
    objectFit: 'cover',
    backgroundColor: '#eaeaea',
    display: 'block',
  };

  const containerStyle: React.CSSProperties = {
    display: 'flex',
    alignItems: 'center',
    padding: 16,
    borderRadius: 12,
    background: '#ffffff',
    boxShadow: '0 6px 16px rgba(0, 0, 0, 0.08)',
    maxWidth: 520,
  };

  const textContainerStyle: React.CSSProperties = {
    marginLeft: 16,
  };

  const usernameStyle: React.CSSProperties = {
    margin: 0,
    fontSize: 18,
    fontWeight: 600,
  };

  const professionStyle: React.CSSProperties = {
    margin: '4px 0 8px 0',
    color: '#6b7280',
    fontSize: 14,
  };

  const bioStyle: React.CSSProperties = {
    margin: 0,
    color: '#374151',
    fontSize: 13,
    lineHeight: 1.4,
  };

  return (
    <div style={containerStyle}>
      {avatarUrl ? (
        <img src={avatarUrl} alt={username} style={avatarStyle} />
      ) : (
        <div
          aria-label="avatar placeholder"
          style={{
            ...avatarStyle,
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: '#6b7280',
            fontWeight: 600,
          }}
        >
          {username.charAt(0).toUpperCase()}
        </div>
      )}
      <div style={textContainerStyle}>
        <p style={usernameStyle}>{username}</p>
        {profession && <p style={professionStyle}>{profession}</p>}
        {bio && <p style={bioStyle}>{bio}</p>}
      </div>
    </div>
  );
};

export default UserProfile;
### END_FILE
